// LoginPage.js
import React from 'react';
import './Loginpage.css';
import Dashboard from './Dashboard';

function LoginPage() {
  const handleLogin = (event) => {
    event.preventDefault(); // Prevent form submission
    window.location.href = '/Dashboard.js'; // Navigate to the dashboard
  };

  const handleForgotPassword = () => {
    // Handle forgot password functionality here
    alert("Forgot Password functionality will be implemented soon!");
  };

  return (
    <div className="login-container">
      <img src="/logo1.png" alt="Logo" className="logo" />
      <h2>Login Page</h2>
      <form onSubmit={handleLogin}> {/* Call handleLogin onSubmit */}
        <label>Email:</label>
        <input type="email" placeholder="Enter email" /><br />
        <label>Password:</label>
        <input type="password" placeholder="Enter password" /><br />
        <button type="submit" className="login-button">Login</button> {/* Change button type to submit */}
      </form>
      <a className="forgot-password-link" onClick={handleForgotPassword}>Forgot Password?</a>
    </div>
  );
}

export default LoginPage;
